(1, 'About Us', 'Strengthen rural economy and improving livelihood through clean tech product and interactive service delivery that brings in organizational growth and sustainability.', '1763803913banner.gif', '1763803913about.gif', '2023-05-23 04:03:59', '2025-11-23 08:41:46', '<p>Solartech Services Foundation (SSF) was incorporated in Bangladesh on 01 January 2023 as a company.</p>\r\n<p>SSF was found with a objective to develop, supply and promoting environment friendly, sustainable and renewable energy including Solar Home System (SHS), bio-mass and all other renewable sources and all conventional and innovative technologies, energy efficient technology and equipment&rsquo;s to rural areas of Bangladesh. It also work in all the areas of environment, social &amp; human development to improve life standard and poverty alleviation of rural poor people.</p>\r\n<p><strong>Executive Committee:</strong></p>\r\n<table width=\"610\">\r\n<tbody>\r\n<tr>\r\n<td width=\"153\">\r\n<p><strong>Name of Employee</strong></p>\r\n</td>\r\n<td width=\"19\">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td width=\"438\">\r\n<p><strong>Designation</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"153\">\r\n<p>MD. Raqibul Hasan</p>\r\n</td>\r\n<td width=\"19\">\r\n<p>:</p>\r\n</td>\r\n<td width=\"438\">\r\n<p>Managing Director</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"153\">\r\n<p>MD. Shah Alam</p>\r\n</td>\r\n<td width=\"19\">\r\n<p>:</p>\r\n</td>\r\n<td width=\"438\">\r\n<p>AGM</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"153\">\r\n<p>Habiba Khatun</p>\r\n</td>\r\n<td width=\"19\">\r\n<p>:</p>\r\n</td>\r\n<td width=\"438\">\r\n<p>Head of Accounts</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"153\">\r\n<p>Parvaz Mahmud</p>\r\n</td>\r\n<td width=\"19\">\r\n<p>:</p>\r\n</td>\r\n<td width=\"438\">\r\n<p>Sr. Business Development Manager</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width=\"153\">\r\n<p>MD. Shawon Mia</p>\r\n</td>\r\n<td width=\"19\">\r\n<p>:</p>\r\n</td>\r\n<td width=\"438\">\r\n<p>Sr. Executive Engineer</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong><u>OUR PROGRAMS:</u></strong></p>\r\n<p>SSF, in areas of environment, social and human development including community engagement, economic empowerment and social business, renewable energy of&nbsp; Bangladesh.</p>\r\n<p><strong>Installation of SHS (Solar Home System)</strong>: One of the main activities of SSF. Since its inception in 2023, SSF has installed Solar Home System (SHS) across the country.</p>\r\n<p><strong>Gov. and NGO Project: </strong>SSF has implemented upazila project across the country installing wide range of solar energy solutions including street lights, SHS and home appliances. SSF has installed lot of SHS, Solar Street Lights, AC with Net-metering and DC system.</p>\r\n<p><strong>Biogas Plant</strong>: To address unavailability of natural gas in rural areas, SSF is interested constructing Bio-Gas plant.&nbsp; SSF provides total solution of plant including after sales service.</p>\r\n<p><strong>Installation of Lightning Arrester</strong><strong>: </strong>Under the Department of Disaster Management Solartech Services Foundation has installation Lightning Arrester in Hosenpur upazila of Kishorganj District. SSF aim is to ensure that no one dies after being struck by lightning.</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Solartech Services Foundation is competent in all activities-</p>\r\n<ul>\r\n<li>Installation, Maintenance &amp; Repair of Solar Street Light (SSL).</li>\r\n<li>Installation of Lightning Arrester.</li>\r\n<li>Installation of Solar Home System (SHS).</li>\r\n<li>Installation of Solar Off-Grid &amp; On-Grid.</li>\r\n<li>Supply of IPS &amp;UPS.</li>\r\n</ul>');

