(1, 1, 1, '2023-05-24', 'Hello3', 'Bashundhora,Dhaka,bangladesh', '1684225289photo.pdf', '1684238157banner.jpg', '<p><strong>Phase 1 &nbsp;Initial Stage </strong></p>\r\n<ul>\r\n<li>Submit the Letter of Intent</li>\r\n</ul>\r\n<p><strong>Phase 2 &nbsp;Full Bid File Submission</strong></p>\r\n<ul>\r\n<li>Submit required application documents (Host City Application Form together with all supporting documents)</li>\r\n</ul>\r\n<p><strong>Phase 3 &nbsp;Bid File Assessment</strong></p>\r\n<ul>\r\n<li>Bid file verification</li>\r\n<li>Site inspection</li>\r\n</ul>\r\n<p><strong>Phase 4 &nbsp;Finalization</strong></p>\r\n<ul>\r\n<li>Approval by IWUF Executive Board and awarding of hosting rights</li>\r\n</ul>\r\n<p><strong>Phase 5 Signing Host City Contract</strong></p>\r\n<ul>\r\n<li>Sign Host City Contract</li>\r\n</ul>', '<h3><strong>Athletes</strong><strong>&rsquo;</strong><strong>&nbsp;Voice</strong><strong>s:</strong></h3>\r\n<p>&ldquo; It was great to see people from all over the world doing the same sport I am doing&hellip; all fighting for that same world title. It was such an intense moment when I set foot into the ring and went toe-to-toe with my biggest competition&hellip; This was by far the best experience of my life and I can&rsquo;t wait to compete against the best again in 2018!&rdquo;</p>\r\n<p>&mdash;&mdash;Audrey Meeks&nbsp;(USA)</p>\r\n<p>&nbsp;</p>\r\n<p>Winning&nbsp;the gold medal at the&nbsp;World Wushu Championships in Jakarta was such a&nbsp;great success for me and a wonderful milestone in my professional career in wushu. The&nbsp;World Wushu Championships is the highest-level&nbsp;championships all around the world,&nbsp;and the best of best compete&nbsp;there.</p>\r\n<p>&mdash;&mdash;Mohsen Mohammadseifi (IRI)</p>\r\n<p>&nbsp;</p>\r\n<p>It means a lot that the World Championships are in Indonesia. It&rsquo;s really been motivating us. I hope this bring a positive energy to the country for wushu. To get the gold medal from Jet Li was awesome.</p>\r\n<p>&mdash;&mdash; Lindswell (INA)</p>\r\n<p>&nbsp;</p>\r\n<p>This gold medal really shows the directions of where we&rsquo;re going and all our hard work, in terms of our training and our dedication, and our passion for wushu is going the right way.</p>\r\n<p>&mdash;&mdash; Elizabeth Lim (AUS)</p>\r\n<p>&nbsp;</p>\r\n<p>My fifth gold medal is my dream. Everybody is cheering me on here, and it gives me 20 times the power to win.</p>\r\n<p>&mdash;&mdash; Muslim Salikhov (RUS)</p>\r\n<p>&nbsp;</p>\r\n<p>There&rsquo;s so much work behind every performance that you do, it just comes out in different ways.</p>\r\n<p>&mdash;&mdash; Tania Sakanaka (BRA)</p>\r\n<p>&nbsp;</p>\r\n<p>The real happiness was not only about getting a medal but also meeting up friends worldwide during the championships!</p>\r\n<p>&mdash;&mdash;HKG Team</p>\r\n<p>&nbsp;</p>\r\n<p>Excellent championships! The live streaming was a highlight for me as our families and team at home were able to tune in.</p>\r\n<p>&mdash;&mdash; BER Team</p>', '<h3><strong>Why Bid for the IWUF Events</strong></h3>\r\n<ul>\r\n<li>World-class Athletes</li>\r\n<li>Great Popularity</li>\r\n<li>Global Attention\r\n<ul>\r\n<li>TV Coverage</li>\r\n<li>Worldwide Distribution</li>\r\n<li>Live Broadcast\r\n<ul>\r\n<li>5 live streaming broadcasting platforms: Wushu TV (YouTube), QQ Live, Le TV, Sina, PhoenixNet.</li>\r\n<li>14th WWC total viewers: 1,267,720; 7th WKFC total viewers: 1,901,812.</li>\r\n</ul>\r\n</li>\r\n<li>Social Media Platforms:\r\n<ul>\r\n<li>Facebook</li>\r\n<li>Twitter</li>\r\n<li>Instagram</li>\r\n<li>WeChat</li>\r\n<li>Weibo</li>\r\n<li>YouTube</li>\r\n<li>Constant Contact</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>The 7<sup>th</sup>&nbsp;World Kungfu Championships (7<sup>th</sup>&nbsp;WKFC) was the largest international event hosted by Emeishan City. More than 3,800 athletes from over 57 countries and regions participated in this event. Hosting the 7<sup>th</sup>&nbsp;WKFC not only boosted the growth of the tourism industry within our city, but also reinforced our confidence to further develop our model of integrating culture, competition and tourism. It has made our city more open, more inclusive,&nbsp;and more confident.</p>\r\n<p>&mdash;&mdash; Emeishan Organizing Committee</p>', '1684735086photo.jpg', '2023-05-16 02:21:29', '2023-05-21 23:58:06'),
(2, 4, 1, '2023-05-16', 'Wushu Virtual Competition', 'Dhaka,Bangladesh', NULL, '1684238157banner.jpg', '<p>dcsdcs</p>', '<p>adcsdc</p>', '<p>sdcsdc</p>', '1684735057photo.jpg', '2023-05-16 05:55:57', '2023-05-21 23:57:37'),
