INSERT INTO `faqs` (`id`, `question`, `answer`, `page_id`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'What is Solartech Services Foundation (SSF)?', 'SSF is a renewable energy and social development company incorporated in Bangladesh in January 2023. We focus on providing environment-friendly energy solutions, such as Solar Home Systems and Biogas, to improve the standard of living in rural areas.', 'home', 1, '2023-05-29 03:54:33', '2025-11-22 05:02:34'),
(2, 'Is SSF a commercial company or a social organization?', 'We operate as a hybrid model. While we provide professional engineering and energy services, our core objective is social and human development. We aim to strengthen the rural economy and alleviate poverty through sustainable technology.', 'home', 1, '2023-05-29 03:55:48', '2025-11-22 05:02:56'),
(3, 'Where does SSF operate?', 'We work across Bangladesh. We have successfully implemented projects in various locations, including specific government projects in the Kishoreganj District (Hosenpur Upazila).', 'home', 1, '2023-05-29 03:57:04', '2025-11-22 05:03:19'),
(4, 'What types of solar systems do you install?', 'We offer a wide range of solar solutions, including:\r\n  1. Solar Home Systems (SHS): For off-grid rural homes.\r\n  2. Solar Street Lights (SSL): For community safety and roads.\r\n  3. On-Grid & Off-Grid Systems: Customized for homes and businesses.\r\n  4. Net-Metering: To help you sell excess electricity back to the grid.', 'home', 1, '2023-05-29 03:58:08', '2025-11-22 05:04:47'),
(5, 'Do you provide solutions for areas without natural gas?', 'Yes. We construct Biogas Plants to address the shortage of natural gas in rural areas. We provide a total solution, from construction to after-sales service, ensuring you have a sustainable fuel source.', 'home', 1, '2023-05-29 03:59:13', '2025-11-22 05:05:14'),
(6, 'Do you supply power backup equipment?', 'Yes, we supply and install IPS (Instant Power Supply) and UPS (Uninterruptible Power Supply) systems to ensure your home or business runs smoothly during power outages.', 'home', 1, '2023-05-29 04:00:08', '2025-11-22 05:05:38'),
(7, 'What is the Lightning Arrester installation service?', 'Bangladesh faces frequent lightning strikes during storms, which can be fatal. SSF installs Lightning Arresters—devices that protect buildings and people by safely directing lightning strikes into the ground. Our goal is to ensure zero fatalities from lightning in the areas we serve.', 'home', 1, '2023-05-29 04:56:20', '2025-11-22 05:06:27'),
(8, 'How can I contact you for a project or consultation?', 'You can reach our business development team directly. Please visit our Contact Us page for phone numbers and our office address.', 'home', 1, '2025-11-22 05:07:01', '2025-11-22 05:07:01');

