INSERT INTO `universities` (`id`, `banner`, `university_name`, `website`, `study_destination_id`, `logo`, `image1`, `image2`, `image3`, `details1`, `details2`, `details3`, `is_active`, `created_at`, `updated_at`) VALUES
(1, '1685258289banner.jpg', 'University of Glasgow', 'https://www.gla.ac.uk/', 1, '1685258289logo.png', '1685258289image.jpg', NULL, NULL, '<h2 class=\"unresponsivestyle\">About the University of Glasgow</h2>\r\n<p><strong>The University of Glasgow has been changing the world since 1451. We are a world top 100 university and a member of the prestigious Russell Group of leading UK research universities.</strong></p>\r\n<p>Our people have always been at the forefront of innovation, including eight Nobel Laureates, two UK Prime Ministers, three First Ministers of Scotland, 10 Fellows of the Royal Society and 11 Fellows of the British Academy. Our past achievements inspire our current world changers.</p>\r\n<p>As a globally connected university, we work in partnership with others across the world to advance global solutions to real world problems. We are proud to be a founding member of the university networks Universitas 21 and The Guild of European Research Intensive Universities.</p>\r\n<p>We are committed to tackling the most pressing global challenges facing humanity and the natural world. We are delivering against the United Nation&rsquo;s 17 Sustainable Development Goals (SDGs) and have pledged to be carbon neutral by 2030. We were the first European university to declare it would divest from fossil fuels by 2024 and the first in Scotland to declare a climate emergency.</p>\r\n<p>We believe that everyone should have fair access to education. We are proud of our long tradition of helping talented people to fulfil their ambitions, regardless of their background or circumstances. Our University of Sanctuary status recognises the safe and welcoming environment we provide for refugees and asylum seekers.</p>\r\n<p>We are home to The Hunterian, our museum and art gallery, one of the leading university museums in the world. We have the world&rsquo;s largest permanent display of the work of James McNeill Whistler and the largest single holding of the work of Charles Rennie Mackintosh.</p>', NULL, NULL, '1', '2023-05-28 01:18:09', '2023-05-28 01:18:09'),
(2, '1685259062banner.jpg', 'University of York', 'https://www.york.ac.uk/', 1, '1685259062logo.svg', '1685259431image.jpg', NULL, NULL, '<p>The <strong>University of York</strong><sup id=\"cite_ref-useofname_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-useofname-6\">[6]</a></sup> (abbreviated as <span class=\"rt-commentedText tooltip tooltip-dotted\" title=\"From the original Latin name Eboracum of the fort and later a city that ultimately developed into the present-day city York.\"><em><strong>Ebor</strong></em></span> or <em><strong>York</strong></em> for <a title=\"Post-nominal letters\" href=\"https://en.wikipedia.org/wiki/Post-nominal_letters\">post-nominals</a>) is a <a title=\"Collegiate university\" href=\"https://en.wikipedia.org/wiki/Collegiate_university\">collegiate</a> <a title=\"Research university\" href=\"https://en.wikipedia.org/wiki/Research_university\">research university</a>, located in the city of <a title=\"York\" href=\"https://en.wikipedia.org/wiki/York\">York</a>, England. Established in 1963, the university has expanded to more than thirty departments and centres, covering a wide range of subjects.</p>\r\n<p>Situated to the south-east of the city of <a title=\"York\" href=\"https://en.wikipedia.org/wiki/York\">York</a>,<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-7\">[7]</a></sup> the university campus is about 500 acres (200 hectares) in size.<sup id=\"cite_ref-8\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-8\">[8]</a></sup> The original campus, Campus West, incorporates the York Science Park and the <a title=\"Science Learning Centres\" href=\"https://en.wikipedia.org/wiki/Science_Learning_Centres\">National Science Learning Centre</a>, and its wildlife, campus lakes and greenery are prominent. In May 2007 the university was granted permission to build an extension to its main campus, on arable land just east of the nearby village of <a title=\"Heslington\" href=\"https://en.wikipedia.org/wiki/Heslington\">Heslington</a>. The second campus, Campus East, opened in 2009<sup id=\"cite_ref-goodrickeopen_9-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-goodrickeopen-9\">[9]</a></sup> and now hosts five colleges and three departments as well as conference spaces, a sports village and a business <a title=\"Startup company\" href=\"https://en.wikipedia.org/wiki/Startup_company\">start-up</a> \'incubator\'. The institution also leases <a title=\"King\'s Manor\" href=\"https://en.wikipedia.org/wiki/King%27s_Manor\">King\'s Manor</a> in York city centre. The university had a total income of &pound;458.8 million in 2021-22 of which &pound;79.7 million was from research grants and contracts, with an expenditure of &pound;542.2 million.<sup id=\"cite_ref-York_Finstat_2022_1-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-York_Finstat_2022-1\">[1]</a></sup></p>\r\n<p>York was one of the first of the <a class=\"mw-redirect\" title=\"Plate Glass University\" href=\"https://en.wikipedia.org/wiki/Plate_Glass_University\">plate glass universities</a> established in the 1960s, and runs a distinctive <a title=\"Collegiate university\" href=\"https://en.wikipedia.org/wiki/Collegiate_university\">collegiate system</a> with 11 colleges as of 2022.<sup id=\"cite_ref-colleges_10-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-colleges-10\">[10]</a></sup> The eleventh college, David Kato, opened in 2022.<sup id=\"cite_ref-11\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-11\">[11]</a></sup><sup id=\"cite_ref-David_Kato_College_12-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-David_Kato_College-12\">[12]</a></sup> In 2012, York joined the <a title=\"Russell Group\" href=\"https://en.wikipedia.org/wiki/Russell_Group\">Russell Group</a> of research-intensive British universities.<sup id=\"cite_ref-13\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_York#cite_note-13\">[13]</a></sup></p>', '', '', '1', '2023-05-28 01:31:02', '2023-05-28 01:37:11'),
(3, '1685259914banner.jpg', 'University of Aberdeen', 'https://www.abdn.ac.uk/', 1, '1685259914logo.png', '1685259914image.jpg', NULL, NULL, '<p>The <strong>University of Aberdeen</strong> (<a title=\"Scots language\" href=\"https://en.wikipedia.org/wiki/Scots_language\">Scots</a>: <em lang=\"sco\">University o\' \'Aiberdeen</em>; abbreviated as <em><strong>Aberd.</strong></em> in <a title=\"List of post-nominal letters (United Kingdom)\" href=\"https://en.wikipedia.org/wiki/List_of_post-nominal_letters_(United_Kingdom)\">post-nominals</a>; <a class=\"mw-redirect\" title=\"Scottish Gaelic language\" href=\"https://en.wikipedia.org/wiki/Scottish_Gaelic_language\">Scottish Gaelic</a>: <em lang=\"gd\">Oilthigh Obar Dheathain</em>) is a <a title=\"Public university\" href=\"https://en.wikipedia.org/wiki/Public_university\">public</a> <a title=\"Research university\" href=\"https://en.wikipedia.org/wiki/Research_university\">research university</a> in <a title=\"Aberdeen\" href=\"https://en.wikipedia.org/wiki/Aberdeen\">Aberdeen</a>, Scotland. It was founded in 1495 when <a title=\"William Elphinstone\" href=\"https://en.wikipedia.org/wiki/William_Elphinstone\">William Elphinstone</a>, <a title=\"Bishop of Aberdeen\" href=\"https://en.wikipedia.org/wiki/Bishop_of_Aberdeen\">Bishop of Aberdeen</a> and <a title=\"Lord Chancellor of Scotland\" href=\"https://en.wikipedia.org/wiki/Lord_Chancellor_of_Scotland\">Chancellor of Scotland</a>, petitioned <a title=\"Pope Alexander VI\" href=\"https://en.wikipedia.org/wiki/Pope_Alexander_VI\">Pope Alexander VI</a> on behalf of <a title=\"James IV of Scotland\" href=\"https://en.wikipedia.org/wiki/James_IV_of_Scotland\">James IV, King of Scots</a> to establish <a title=\"King\'s College, Aberdeen\" href=\"https://en.wikipedia.org/wiki/King%27s_College,_Aberdeen\">King\'s College</a>,<sup id=\"cite_ref-foundation_5-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Aberdeen#cite_note-foundation-5\">[5]</a></sup> making it one of Scotland\'s four <a title=\"Ancient universities of Scotland\" href=\"https://en.wikipedia.org/wiki/Ancient_universities_of_Scotland\">ancient universities</a> and the <a title=\"List of oldest universities in continuous operation\" href=\"https://en.wikipedia.org/wiki/List_of_oldest_universities_in_continuous_operation\">fifth-oldest university</a> in the <a title=\"English-speaking world\" href=\"https://en.wikipedia.org/wiki/English-speaking_world\">English-speaking world</a>. Along with the universities of <a title=\"University of Edinburgh\" href=\"https://en.wikipedia.org/wiki/University_of_Edinburgh\">Edinburgh</a>, <a title=\"University of Glasgow\" href=\"https://en.wikipedia.org/wiki/University_of_Glasgow\">Glasgow</a>, and <a title=\"University of St Andrews\" href=\"https://en.wikipedia.org/wiki/University_of_St_Andrews\">St Andrews</a>, the <a title=\"University\" href=\"https://en.wikipedia.org/wiki/University\">university</a> was part of the <a title=\"Scottish Enlightenment\" href=\"https://en.wikipedia.org/wiki/Scottish_Enlightenment\">Scottish Enlightenment</a> during the 18th century.</p>\r\n<p>The university comprises three colleges&mdash;<a title=\"King\'s College, Aberdeen\" href=\"https://en.wikipedia.org/wiki/King%27s_College,_Aberdeen\">King\'s College</a>, <a title=\"Marischal College\" href=\"https://en.wikipedia.org/wiki/Marischal_College\">Marischal College</a>, and <a title=\"Christ\'s College, Aberdeen\" href=\"https://en.wikipedia.org/wiki/Christ%27s_College,_Aberdeen\">Christ\'s College</a>&mdash;that are now mainly ceremonial. The university as it is currently constituted was formed in 1860 by a merger between <a title=\"King\'s College, Aberdeen\" href=\"https://en.wikipedia.org/wiki/King%27s_College,_Aberdeen\">King\'s College</a> and <a title=\"Marischal College\" href=\"https://en.wikipedia.org/wiki/Marischal_College\">Marischal College</a>, a second university founded in 1593 as a Protestant alternative to the former. The university\'s iconic buildings act as symbols of wider Aberdeen, particularly Marischal College in the city centre and the <a title=\"Crown steeple\" href=\"https://en.wikipedia.org/wiki/Crown_steeple\">crown steeple</a> of King\'s College in <a title=\"Old Aberdeen\" href=\"https://en.wikipedia.org/wiki/Old_Aberdeen\">Old Aberdeen</a>. There are two campuses; the predominantly utilised King\'s College campus dominates the section of the city known as <a title=\"Old Aberdeen\" href=\"https://en.wikipedia.org/wiki/Old_Aberdeen\">Old Aberdeen</a>, which is approximately two miles north of the city centre. Although the original site of the university\'s foundation, most academic buildings apart from the King\'s College Chapel and Quadrangle were constructed in the 20th century during a period of significant expansion. The university\'s <a title=\"Foresterhill\" href=\"https://en.wikipedia.org/wiki/Foresterhill\">Foresterhill</a> campus is next to <a title=\"Aberdeen Royal Infirmary\" href=\"https://en.wikipedia.org/wiki/Aberdeen_Royal_Infirmary\">Aberdeen Royal Infirmary</a> and houses the <a title=\"University of Aberdeen School of Medicine and Dentistry\" href=\"https://en.wikipedia.org/wiki/University_of_Aberdeen_School_of_Medicine_and_Dentistry\">School of Medicine and Dentistry</a> as well as the School of Medical Sciences. Together these buildings form one of Europe\'s largest health campuses.<sup id=\"cite_ref-6\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Aberdeen#cite_note-6\">[6]</a></sup> The annual income of the institution for 2021&ndash;22 was &pound;260.9&nbsp;million of which &pound;50.8&nbsp;million was from research grants and contracts, with an expenditure of &pound;313.4&nbsp;million.<sup id=\"cite_ref-accounts_2-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Aberdeen#cite_note-accounts-2\">[2]</a></sup></p>\r\n<p>Aberdeen is consistently ranked among the top 160 universities in the world<sup id=\"cite_ref-:0_7-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Aberdeen#cite_note-:0-7\">[7]</a></sup> and is ranked within the top 20 universities in the United Kingdom according to <em><a title=\"The Times\" href=\"https://en.wikipedia.org/wiki/The_Times\">The Times</a></em> and <em><a title=\"The Sunday Times\" href=\"https://en.wikipedia.org/wiki/The_Sunday_Times\">The Sunday Times</a></em>, and 13th in the UK according to <em><a title=\"The Guardian\" href=\"https://en.wikipedia.org/wiki/The_Guardian\">The Guardian</a></em>. Aberdeen has 15,185 students from undergraduate to doctoral level (as of 2019/20), including many international students. An abundant range of disciplines are taught at the university, with 650 undergraduate degree programmes offered in the 2012&ndash;13 academic year. Aberdeen has educated a wide range of notable alumni, and the university played key roles in the <a title=\"Scottish Reformation\" href=\"https://en.wikipedia.org/wiki/Scottish_Reformation\">Scottish Reformation</a>, <a title=\"Scottish Enlightenment\" href=\"https://en.wikipedia.org/wiki/Scottish_Enlightenment\">Scottish Enlightenment</a>, and the <a title=\"Scottish Renaissance\" href=\"https://en.wikipedia.org/wiki/Scottish_Renaissance\">Scottish Renaissance</a>. Five Nobel laureates have since been associated with the university: two in <a title=\"Nobel Prize in Chemistry\" href=\"https://en.wikipedia.org/wiki/Nobel_Prize_in_Chemistry\">Chemistry</a>, one in <a title=\"Nobel Prize in Physiology or Medicine\" href=\"https://en.wikipedia.org/wiki/Nobel_Prize_in_Physiology_or_Medicine\">Physiology or Medicine</a>, one in <a title=\"Nobel Prize in Physics\" href=\"https://en.wikipedia.org/wiki/Nobel_Prize_in_Physics\">Physics</a>, and one in <a title=\"Nobel Peace Prize\" href=\"https://en.wikipedia.org/wiki/Nobel_Peace_Prize\">Peace</a>.<sup id=\"cite_ref-FastFacts_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Aberdeen#cite_note-FastFacts-8\">[8]</a></sup></p>', NULL, NULL, '1', '2023-05-28 01:45:14', '2023-05-28 01:45:14'),
(4, '1685260174banner.jpg', 'University of Dundee', 'https://www.dundee.ac.uk/', 1, '1685260174logo.webp', '1685260174image.jpg', NULL, NULL, '<p>The <strong>University of Dundee</strong><sup id=\"cite_ref-6\" class=\"reference\"></sup> is a <a title=\"Public university\" href=\"https://en.wikipedia.org/wiki/Public_university\">public</a> <a title=\"Research university\" href=\"https://en.wikipedia.org/wiki/Research_university\">research university</a> based in <a title=\"Dundee\" href=\"https://en.wikipedia.org/wiki/Dundee\">Dundee</a>, Scotland. It was founded as a <a title=\"University college\" href=\"https://en.wikipedia.org/wiki/University_college#United_Kingdom\">university college</a> in 1881 with a donation from the prominent Baxter family of <a title=\"History of Dundee\" href=\"https://en.wikipedia.org/wiki/History_of_Dundee#Industrial_revolution\">textile manufacturers</a>. The institution was, for most of its early existence, a <a title=\"Collegiate university\" href=\"https://en.wikipedia.org/wiki/Collegiate_university\">constituent college</a> of the <a title=\"University of St Andrews\" href=\"https://en.wikipedia.org/wiki/University_of_St_Andrews\">University of St Andrews</a> alongside <a title=\"United College, St Andrews\" href=\"https://en.wikipedia.org/wiki/United_College,_St_Andrews\">United College</a> and <a title=\"St Mary\'s College, St Andrews\" href=\"https://en.wikipedia.org/wiki/St_Mary%27s_College,_St_Andrews\">St Mary\'s College</a> located in the town of <a title=\"St Andrews\" href=\"https://en.wikipedia.org/wiki/St_Andrews\">St Andrews</a> itself. Following significant expansion, the University of Dundee gained independent university status by <a title=\"Royal charter\" href=\"https://en.wikipedia.org/wiki/Royal_charter\">royal charter</a> in 1967 while retaining elements of its <a title=\"Ancient university\" href=\"https://en.wikipedia.org/wiki/Ancient_university\">ancient</a> heritage and <a title=\"Ancient university governance in Scotland\" href=\"https://en.wikipedia.org/wiki/Ancient_university_governance_in_Scotland\">governance structure</a>.</p>\r\n<p>The main campus of the university is located in Dundee\'s <a title=\"West End, Dundee\" href=\"https://en.wikipedia.org/wiki/West_End,_Dundee\">West End</a>, which contains many of the university\'s teaching and research facilities; the <a class=\"mw-redirect\" title=\"\" href=\"https://en.wikipedia.org/wiki/Duncan_of_Jordanstone_College_of_Art_and_Design\">Duncan of Jordanstone College of Art and Design</a>, <a title=\"Dundee Law School\" href=\"https://en.wikipedia.org/wiki/Dundee_Law_School\">Dundee Law School</a> and the Dundee Dental Hospital and School. The university has additional facilities at <a title=\"Ninewells Hospital\" href=\"https://en.wikipedia.org/wiki/Ninewells_Hospital\">Ninewells Hospital</a>, containing its <a class=\"mw-redirect\" title=\"University of Dundee Medical School\" href=\"https://en.wikipedia.org/wiki/University_of_Dundee_Medical_School\">school of medicine</a>; <a title=\"Perth Royal Infirmary\" href=\"https://en.wikipedia.org/wiki/Perth_Royal_Infirmary\">Perth Royal Infirmary</a>, which houses a clinical research centre; and in <a title=\"Kirkcaldy\" href=\"https://en.wikipedia.org/wiki/Kirkcaldy\">Kirkcaldy</a>, <a title=\"Fife\" href=\"https://en.wikipedia.org/wiki/Fife\">Fife</a>, containing part of its school of nursing and health sciences. The annual income of the institution for 2021&ndash;22 was &pound;291.5&nbsp;million of which &pound;71.8&nbsp;million was from research grants and contracts, with an expenditure of &pound;344.8&nbsp;million.<sup id=\"cite_ref-accounts_2-2\" class=\"reference\"></sup></p>', NULL, NULL, '1', '2023-05-28 01:49:34', '2023-05-28 01:49:34'),
(5, '1685266289banner.jpg', 'University of Sussex', 'https://www.sussex.ac.uk/', 1, '1685266289logo.png', '1685266289image.jpg', '1685266478image2.jpg', NULL, '<p>he university was founded with the unusual structure of \"Schools of Study\" (ubiquitously abbreviated to \"schools\") rather than traditional university departments within arts and science faculties.</p>\r\n<p>In the early 1990s, the university promoted the system by claiming \"[c]lusters of faculty [come] together within schools to pursue new areas of intellectual enquiry. The schools also foster broader intellectual links. <em>Physics with Management Studies, Science and Engineering with European Studies, Economics with Mathematics</em> all reach beyond conventional Arts/Science divisions.\"<sup id=\"cite_ref-42\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-42\">[42]</a></sup> By this time the original schools had been developed somewhat and were:</p>\r\n<ul>\r\n<li>African and Asian Studies <em>(abbreviated to AFRAS)</em></li>\r\n<li>Biological Sciences <em>(BIOLS)</em></li>\r\n<li>Chemistry and Molecular Sciences <em>(MOLS)</em></li>\r\n<li>Cognitive and Computing Sciences <em>(COGS)</em></li>\r\n<li>Cultural and Community Studies <em>(CCS)</em></li>\r\n<li>Engineering and Applied Sciences <em>(ENGG, formerly EAPS)</em></li>\r\n<li>English and American <em>(ENGAM or EAM)</em></li>\r\n<li>European Studies <em>(EURO)</em></li>\r\n<li>Mathematical and Physical Sciences <em>(MAPS)</em></li>\r\n<li>Social Sciences <em>(SOC)</em></li>\r\n</ul>', '<p>There was also the <a title=\"Institute of Development Studies\" href=\"https://en.wikipedia.org/wiki/Institute_of_Development_Studies\">Institute of Development Studies</a> <em>(IDS)</em>. This is still located on Sussex\'s campus, but is now a separate institution.</p>\r\n<p>In 2001, as the university celebrated its 40th anniversary, the then Vice-Chancellor Alasdair Smith proposed major changes to the curriculum across the \"Arts schools\", and the senate agreed to structural changes which would create two Arts schools and a \"Sussex Institute\" in place of the five schools then in place. Corresponding changes would be made in Sciences.<sup id=\"cite_ref-43\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-43\">[43]</a></sup></p>\r\n<p>The changes were finally implemented in September 2003.<sup id=\"cite_ref-44\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-44\">[44]</a></sup> After discussion in senate and the schools, disciplinary departments which had been located across the different schools, were located firmly within one school, and undergraduates were offered straightforward degree subjects. The multi-disciplinarity provided by the school courses was now to be achieved through elective courses from other departments and schools.</p>\r\n<p>In 2009 the university adopted a new organisational structure. The term \"Schools of Studies\" was retained, but each was headed by a \"Head of School\" rather than the traditional \"Dean\".</p>\r\n<p>In 2020 the School of English, School of History, Art History and Philosophy, and School of Media, Film and Music were merged to create the School of Media, Arts and Humanities.<sup id=\"cite_ref-45\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-45\">[45]</a></sup></p>\r\n<p>The schools as of 2020 are listed below.<sup id=\"cite_ref-schools_46-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-schools-46\">[46]</a></sup></p>\r\n<p>The term \"department\" has been retained in some cases, where a school contains separate disciplines.</p>\r\n<ul>\r\n<li>School of Engineering and Informatics (two separate schools before 2011)<sup id=\"cite_ref-47\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-47\">[47]</a></sup></li>\r\n<li>School of Life Sciences (includes Biology, Environmental Science, Chemistry and Biochemistry and houses the Centre for Genome Damage and Stability)</li>\r\n<li>School of Mathematical and Physical Sciences (MPS) (includes Mathematics, Physics and Astronomy)</li>\r\n<li>School of Psychology</li>\r\n<li>School of Education and Social Work (ESW)</li>\r\n<li>School of Global Studies (includes Anthropology,<sup id=\"cite_ref-48\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-48\">[48]</a></sup> Geography, International Development and International Relations, as well as interdisciplinary programmes in Development Studies)</li>\r\n<li>School of Law, Politics and Sociology (LPS)</li>\r\n<li>School of Media, Arts and Humanities (MAH) (three separate schools before 2020)</li>\r\n<li>University of Sussex Business School</li>\r\n</ul>\r\n<p>None of these changes have affected the <a title=\"Brighton and Sussex Medical School\" href=\"https://en.wikipedia.org/wiki/Brighton_and_Sussex_Medical_School\">Brighton and Sussex Medical School</a> (BSMS).</p>\r\n<p>The Doctoral School supports PhD student and Post-docs across all schools and departments and supports PhD students and Post-Docs through the Sussex Research hive, the Researcher Development Program, funding schemes as well as its own partnerships.<sup id=\"cite_ref-49\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Sussex#cite_note-49\">[49]</a></sup></p>', NULL, '1', '2023-05-28 03:31:29', '2023-05-28 03:34:38'),
(6, '1685269108banner.jpg', 'Coventry University', 'https://www.coventry.ac.uk', 1, '1685269108logo.jpg', '1685269108image.jpg', NULL, NULL, '<p><strong>Coventry University</strong> is a <a title=\"Public university\" href=\"https://en.wikipedia.org/wiki/Public_university\">public</a> research university in <a title=\"Coventry\" href=\"https://en.wikipedia.org/wiki/Coventry\">Coventry</a>, England. The origins of Coventry University can be linked to the founding of the <a title=\"Coventry School of Art and Design\" href=\"https://en.wikipedia.org/wiki/Coventry_School_of_Art_and_Design\">Coventry School of Design</a> in 1843. It was known as <strong>Lanchester Polytechnic</strong> from 1970 until 1987, and then as <strong>Coventry Polytechnic</strong> until the <a title=\"Further and Higher Education Act 1992\" href=\"https://en.wikipedia.org/wiki/Further_and_Higher_Education_Act_1992\">Further and Higher Education Act 1992</a> afforded its university status that year and the name was changed to Coventry University.</p>\r\n<p><a title=\"Coventry\" href=\"https://en.wikipedia.org/wiki/Coventry\">Coventry</a> is the larger of the two universities in the city, the other being the <a title=\"University of Warwick\" href=\"https://en.wikipedia.org/wiki/University_of_Warwick\">University of Warwick</a>. It is the UK\'s fastest growing university and the <a title=\"List of universities in the United Kingdom by enrolment\" href=\"https://en.wikipedia.org/wiki/List_of_universities_in_the_United_Kingdom_by_enrolment\">country\'s fourth largest</a> overall.<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Coventry_University#cite_note-7\">[7]</a></sup> It has two principal campuses: one in the centre of <a title=\"Coventry\" href=\"https://en.wikipedia.org/wiki/Coventry\">Coventry</a> where the majority of its operations are located, and one in <a title=\"Central London\" href=\"https://en.wikipedia.org/wiki/Central_London\">Central London</a> which focuses on business and management courses. Coventry also governs their other higher education institutions <a title=\"CU Coventry\" href=\"https://en.wikipedia.org/wiki/CU_Coventry\">CU Coventry</a>, <a title=\"CU Scarborough\" href=\"https://en.wikipedia.org/wiki/CU_Scarborough\">CU Scarborough</a> and <a title=\"CU London\" href=\"https://en.wikipedia.org/wiki/CU_London\">CU London</a>, all of which market themselves as an \"alternative to mainstream higher education\".<sup id=\"cite_ref-8\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Coventry_University#cite_note-8\">[8]</a></sup> Its four faculties, which are made up of schools and departments, run around 300 undergraduate and postgraduate courses. Across the university there are 11 research centres which specialise in different fields, from agroecology and peace studies to future of transport.</p>\r\n<p>The annual income of the institution for 2021&ndash;22 was &pound;447.3&nbsp;million of which &pound;15.8&nbsp;million was from research grants and contracts, with an expenditure of &pound;463.4&nbsp;million.<sup id=\"cite_ref-annacc_1-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Coventry_University#cite_note-annacc-1\">[1]</a></sup> The university holds a Gold rating in the 2017 <a title=\"Teaching Excellence Framework\" href=\"https://en.wikipedia.org/wiki/Teaching_Excellence_Framework\">Teaching Excellence Framework</a>.<sup id=\"cite_ref-9\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Coventry_University#cite_note-9\">[9]</a></sup> Coventry is a member of the <a title=\"University Alliance\" href=\"https://en.wikipedia.org/wiki/University_Alliance\">University Alliance</a> mission group.</p>', NULL, NULL, '1', '2023-05-28 04:18:28', '2023-05-28 04:21:46'),
(7, '1685269587banner.jpg', 'Glasgow Caledonian University', 'https://www.gcu.ac.uk/', 1, '1685269587logo.png', '1685269587image.webp', NULL, NULL, '<p>What better destination to begin your adventure than the &lsquo;friendliest city in the world&rsquo;. Glasgow is home to a wealth of cultural landmarks, vibrant music, sports and social scenes, and over 90 parks and gardens. It isn\'t hard to see why the city is regarded as a must-visit destination.</p>\r\n<p>At Glasgow Caledonian University, we provide our international students with superb facilities, teaching excellence and high-quality vocational education. These are just a few of the reasons that GCU is the top choice for students from more than 120 countries.</p>', NULL, NULL, '1', '2023-05-28 04:26:27', '2023-05-28 04:26:27'),
(8, '1685269934banner.jpg', 'Bangor University', 'https://www.bangor.ac.uk/', 1, '1685269934logo.png', '1685269934image.jpg', NULL, NULL, '<p>The Academic Activities of Bangor University are grouped into three colleges:</p>\r\n<div class=\"div-col\">\r\n<dl>\r\n<dt>College of Arts, Humanities and Business</dt>\r\n</dl>\r\n<ul>\r\n<li>Bangor Business School</li>\r\n<li>School of History, Law and Social Sciences</li>\r\n<li>School of Arts, Culture and Language</li>\r\n</ul>\r\n<dl>\r\n<dt>College of Environmental Sciences and Engineering</dt>\r\n</dl>\r\n<ul>\r\n<li>School of Computer Science and Electronic Engineering</li>\r\n<li>School of Natural Sciences</li>\r\n<li>School of Ocean Sciences</li>\r\n</ul>\r\n<dl>\r\n<dt>College of Human Sciences</dt>\r\n</dl>\r\n<ul>\r\n<li>School of Educational Sciences</li>\r\n<li>School of Medical and Health Sciences</li>\r\n<li>School of Human and Behavioural Sciences</li>\r\n</ul>\r\n</div>', NULL, NULL, '1', '2023-05-28 04:32:14', '2023-05-28 04:32:14'),
(9, '1685270191banner.jpg', 'University for the Creative Arts', 'https://www.uca.ac.uk/', 1, '1685270191logo.jpg', '1685270191image.jpg', NULL, NULL, '<p>UCA is the third largest provider of design, and creative and performing arts higher education in the UK, with around 5,845 students.<sup id=\"cite_ref-32\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_for_the_Creative_Arts#cite_note-32\">[32]</a></sup> It offers courses in a very wide range of architecture, art, crafts, design, fashion, media and performing arts subjects.<sup id=\"cite_ref-33\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_for_the_Creative_Arts#cite_note-33\">[33]</a></sup></p>\r\n<p>Courses are offered at <a title=\"Further education\" href=\"https://en.wikipedia.org/wiki/Further_education\">pre-degree further education</a>, <a title=\"Undergraduate degree\" href=\"https://en.wikipedia.org/wiki/Undergraduate_degree\">undergraduate</a>, <a title=\"Postgraduate education\" href=\"https://en.wikipedia.org/wiki/Postgraduate_education\">taught postgraduate</a> and <a class=\"mw-redirect\" title=\"Doctoral\" href=\"https://en.wikipedia.org/wiki/Doctoral\">doctoral</a> levels.<sup id=\"cite_ref-34\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_for_the_Creative_Arts#cite_note-34\">[34]</a></sup></p>\r\n<p>The University is organised into ten academic schools: Business School for the Creative Industries, Canterbury School of Architecture &amp; Design, School of Communications, School of Fashion &amp; Textiles, School of Film, Media &amp; Performing Arts, School of Fine Art, Crafts &amp; Photography, School of Games &amp; Creative Technology, UCA Doctoral College, UCA International College (UCAIC), and Institute of Creativity and Innovation (ICI).<sup id=\"cite_ref-35\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_for_the_Creative_Arts#cite_note-35\">[35]</a></sup></p>\r\n<p>It has eight research centres: Centre for Sustainable Design, Crafts Study Centre, Animation Research Centre, International Textile Research Centre, Audio Research Cluster, Cluster for Cinema/Affect/Place (CCAP), Conflict and the Creative Arts Research Centre, and UCA Innovation Hub.<sup id=\"cite_ref-36\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_for_the_Creative_Arts#cite_note-36\">[36]</a></sup></p>\r\n<p>The UK\'s first <a class=\"mw-redirect\" title=\"Business School\" href=\"https://en.wikipedia.org/wiki/Business_School\">Business School</a> for the <a class=\"mw-redirect\" title=\"Creative Industries\" href=\"https://en.wikipedia.org/wiki/Creative_Industries\">Creative Industries</a> is based at UCA Epsom.<sup id=\"cite_ref-37\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_for_the_Creative_Arts#cite_note-37\">[37]</a></sup></p>', NULL, NULL, '1', '2023-05-28 04:36:31', '2023-05-28 04:36:31'),
(10, '1685270468banner.jpg', 'University of Hertfordshire', 'https://www.herts.ac.uk/', 1, '1685270468logo.png', '1685270468image.jpg', NULL, NULL, '<p>The university\'s School of Pharmacy has been awarded full <a title=\"Royal Pharmaceutical Society of Great Britain\" href=\"https://en.wikipedia.org/wiki/Royal_Pharmaceutical_Society_of_Great_Britain\">Royal Pharmaceutical Society of Great Britain</a> accreditation.<sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space: nowrap;\">[<em><a title=\"Wikipedia:Citation needed\" href=\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources. (December 2018)\">citation needed</span></a></em>]</sup> The University of Hertfordshire is recognised as one of the top twenty universities in the world to study animation.<sup id=\"cite_ref-59\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Hertfordshire#cite_note-59\">[58]</a></sup></p>\r\n<p>According to <a title=\"Destination of Leavers from Higher Education\" href=\"https://en.wikipedia.org/wiki/Destination_of_Leavers_from_Higher_Education\">Destination of Leavers from Higher Education</a> 2012&ndash;13 93.2 per cent of its full-time, first degree UK graduates are in work or further study within six months of graduating.<sup id=\"cite_ref-ReferenceC_43-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Hertfordshire#cite_note-ReferenceC-43\">[42]</a></sup> Four of the university\'s schools achieved scores of 98 per cent: physics; astronomy and mathematics; health and social work; law and education. The survey, conducted by the UK\'s <a title=\"Higher Education Statistics Agency\" href=\"https://en.wikipedia.org/wiki/Higher_Education_Statistics_Agency\">Higher Education Statistics Agency</a> (HESA), revealed in its UK Performance Indicators for Employment 2013/14 that the University of Hertfordshire has climbed 30 places in the past year and is now ranked 35th out of 152 universities in the UK.</p>\r\n<p>In September 2015, the <a class=\"mw-redirect\" title=\"Complete University Guide\" href=\"https://en.wikipedia.org/wiki/Complete_University_Guide\">Complete University Guide</a> showed that the university has the lowest recorded \'student-relevant\' crimes in the <a title=\"East of England\" href=\"https://en.wikipedia.org/wiki/East_of_England\">East of England</a>. It is the fourth year the university has had the lowest rate of recorded crime in the East of England.<sup id=\"cite_ref-60\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Hertfordshire#cite_note-60\">[59]</a></sup> For university\'s commitment to gender equality, it was regranted <a title=\"Athena SWAN\" href=\"https://en.wikipedia.org/wiki/Athena_SWAN\">Athena Swan</a>\'s Bronze institutional status.<sup id=\"cite_ref-61\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Hertfordshire#cite_note-61\">[60]</a></sup></p>\r\n<p>The University of Hertfordshire won the Guardian University Award for Student Experience in 2015.<sup id=\"cite_ref-:0_62-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Hertfordshire#cite_note-:0-62\">[61]</a></sup></p>', NULL, NULL, '1', '2023-05-28 04:41:08', '2023-05-28 04:41:08'),
(11, '1685270681banner.jpg', 'University of Worcester', 'https://www.worcester.ac.uk/', 1, '1685270681logo.png', '1685270681image.jpg', NULL, NULL, '<p>In 1946 an Emergency <a class=\"mw-redirect\" title=\"Teacher training college\" href=\"https://en.wikipedia.org/wiki/Teacher_training_college\">teacher training college</a> for the University of Birmingham was established in Worcester on the site of one of the former RAF bases used during the Second World War. Henry Hines came to Worcester from the Canterbury Technical Institute as the principal of the college. E.G. Peirson followed Hines\'s lead as the principal of the college from 1951 to 1978. During his time at the college, in the 1970s the <a title=\"Council for National Academic Awards\" href=\"https://en.wikipedia.org/wiki/Council_for_National_Academic_Awards\">Council for National Academic Awards</a> validated the degrees for the <strong>Worcester College of Higher Education</strong> and the former Peirson Library, now The Peirson Study and Guidance Centre was opened. The third principal of the college, David Shadbolt, started his leadership in 1978 bringing a new system of organisation, based around three schools &ndash; Education and Teaching Studies, Arts and Sciences. In 1992, Dorma Urwin became the new principal and <a title=\"Coventry University\" href=\"https://en.wikipedia.org/wiki/Coventry_University\">Coventry University</a> agreed to validate the institution\'s degree courses.<sup id=\"cite_ref-6\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Worcester#cite_note-6\">[6]</a></sup> The Herefordshire and Worcestershire College of Nursing and Midwifery was absorbed in 1995. In 1997 the <a class=\"mw-redirect\" title=\"Privy Council of the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Privy_Council_of_the_United_Kingdom\">Privy Council</a> affirmed the institution\'s <a title=\"Academic degree\" href=\"https://en.wikipedia.org/wiki/Academic_degree\">degree</a>-awarding powers and it subsequently became known as <strong>University College Worcester</strong>. In 2003, <a title=\"David Green (university administrator)\" href=\"https://en.wikipedia.org/wiki/David_Green_(university_administrator)\">David Green</a> was appointed as Dorma Urwin\'s successor and later became the vice chancellor of the institution. In 2005 the Privy Council granted university status. The institution was renamed \"University of Worcester\" in September of that year. In 2010 the HM Privy Council conferred research degree-awarding powers on the university. In the same year, the university opened the City campus in the renovated former infirmary to create a home for the Business School. Two years later, in 2012, the university opened <a title=\"The Hive, Worcester\" href=\"https://en.wikipedia.org/wiki/The_Hive,_Worcester\">The Hive</a>, a &pound;60 million facility focused on learning resources, technology, social and study spaces. This facility is a joint venture between the university and <a title=\"Worcestershire County Council\" href=\"https://en.wikipedia.org/wiki/Worcestershire_County_Council\">Worcestershire County Council</a> and was officially opened by Her Majesty The Queen.<sup id=\"cite_ref-:0_5-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Worcester#cite_note-:0-5\">[5]</a></sup></p>\r\n<p>In 2021, the university decided to close its archaeology department, with the change to come into effect the end of the 2021/22 academic year; this led to a petition being started, asking the vice-chancellor and executive board to reconsider the decision.<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Worcester#cite_note-7\">[7]</a></sup></p>', NULL, NULL, '1', '2023-05-28 04:44:41', '2023-05-28 04:44:41'),
(12, '1685270923banner.jpg', 'University of Portsmouth', 'https://www.port.ac.uk/', 1, '1685270923logo.png', '1685270923image.webp', NULL, NULL, '<p>Portsmouth offers more than 200 undergraduate degrees and 150 postgraduate degrees, as well as 65 research degree programs.<sup id=\"cite_ref-Facts&amp;Figures2012-13_37-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-Facts&amp;Figures2012-13-37\">[36]</a></sup></p>\r\n<p>The university formerly validated BSc (Hons) degrees in <a title=\"Acupuncture\" href=\"https://en.wikipedia.org/wiki/Acupuncture\">Acupuncture</a> and MSc courses in <a title=\"Traditional Chinese medicine\" href=\"https://en.wikipedia.org/wiki/Traditional_Chinese_medicine\">Traditional Chinese medicine</a> that were carried out by the <em>London College of Traditional Acupuncture and Oriental Medicine,</em> a private education provider that collapsed in early 2011.<sup id=\"cite_ref-38\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-38\">[37]</a></sup></p>\r\n<h3><span id=\"Research\" class=\"mw-headline\">Research</span></h3>\r\n<p>Over 60% of research submitted by the university to REF2014 was rated as world-leading and internationally excellent.<sup id=\"cite_ref-results.ref.ac.uk_39-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-results.ref.ac.uk-39\">[38]</a></sup> In two subject areas respectively &ndash; Allied Health Professions, Dentistry, Nursing and Pharmacy, and Physics &ndash; 90% and 89% of all research submitted was rated as world leading and internationally excellent.<sup id=\"cite_ref-results.ref.ac.uk_39-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-results.ref.ac.uk-39\">[38]</a></sup></p>\r\n<p>In 2017 <a title=\"Alessandro Melis\" href=\"https://en.wikipedia.org/wiki/Alessandro_Melis\">Alessandro Melis</a><sup id=\"cite_ref-40\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-40\">[39]</a></sup> and Steffen Lehmann created the interdisciplinary project CRUNCH: Climate Resilient Urban Nexus Choices: Operationalising the Food-Water-Energy Nexus. This is a &pound;1.6 million research project funded by Horizon 2020, Belmont Forum, ESRC and other funding bodies. University of Portsmouth is leading the project. The partners are five universities from Miami, Eindhoven, Gdansk, Uppsala and Taiwan. Crunch involves universities, local authorities and small business.<sup id=\"cite_ref-41\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-41\">[40]</a></sup><sup id=\"cite_ref-42\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-42\">[41]</a></sup></p>\r\n<h3><span id=\"Rankings\" class=\"mw-headline\">Rankings</span></h3>\r\n<table class=\"infobox\"><caption class=\"infobox-title\"><a title=\"College and university rankings\" href=\"https://en.wikipedia.org/wiki/College_and_university_rankings\">Rankings</a></caption>\r\n<tbody>\r\n<tr>\r\n<th class=\"infobox-header\" style=\"background-color: #e0e0e0;\" colspan=\"2\"><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom\">National rankings</a></th>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom#The_Complete_University_Guide\">Complete</a></em> (2023)<sup id=\"cite_ref-Complete_League_Table_43-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-Complete_League_Table-43\">[42]</a></sup></th>\r\n<td class=\"infobox-data\">69</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom#The_Guardian\">Guardian</a></em> (2023)<sup id=\"cite_ref-The_Guardian_University_Guide_44-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-The_Guardian_University_Guide-44\">[43]</a></sup></th>\r\n<td class=\"infobox-data\">67</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom#The_Times/The_Sunday_Times\">Times / Sunday Times</a></em> (2023)<sup id=\"cite_ref-The_Times_and_Sunday_Times_University_Guide_45-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-The_Times_and_Sunday_Times_University_Guide-45\">[44]</a></sup></th>\r\n<td class=\"infobox-data\">88</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-header\" style=\"background-color: #e0e0e0;\" colspan=\"2\">Global rankings</th>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Academic Ranking of World Universities\" href=\"https://en.wikipedia.org/wiki/Academic_Ranking_of_World_Universities\">ARWU</a></em> (2022)<sup id=\"cite_ref-Academic_Ranking_of_World_Universities_46-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-Academic_Ranking_of_World_Universities-46\">[45]</a></sup></th>\r\n<td class=\"infobox-data\">801-900</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"QS World University Rankings\" href=\"https://en.wikipedia.org/wiki/QS_World_University_Rankings\">QS</a></em> (2023)<sup id=\"cite_ref-QS_World_University_Rankings_47-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-QS_World_University_Rankings-47\">[46]</a></sup></th>\r\n<td class=\"infobox-data\">701-750</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Times Higher Education World University Rankings\" href=\"https://en.wikipedia.org/wiki/Times_Higher_Education_World_University_Rankings\">THE</a></em> (2023)<sup id=\"cite_ref-THE_World_University_Rankings_48-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-THE_World_University_Rankings-48\">[47]</a></sup></th>\r\n<td class=\"infobox-data\">401&ndash;500</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>The University of Portsmouth is one of only four universities in the south east to achieve the highest Gold rating in the <a title=\"Teaching Excellence Framework\" href=\"https://en.wikipedia.org/wiki/Teaching_Excellence_Framework\">Teaching Excellence Framework</a> (TEF).<sup id=\"cite_ref-49\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-49\">[48]</a></sup><sup id=\"cite_ref-50\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-50\">[49]</a></sup></p>\r\n<p>Most recently, in the 2022 edition of the Good University Guide &ndash; compiled by The Times and Sunday Times &ndash; the university was ranked near the bottom at 88 out of 132.</p>\r\n<p>Internationally, the university was ranked 98th in Times Higher Education\'s \'100 under 50\' rankings of international modern universities 2017 but did not make the list in any subsequent year.<sup id=\"cite_ref-timeshighereducation.com_51-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-timeshighereducation.com-51\">[50]</a></sup></p>\r\n<p>Portsmouth was rated in the top 501 &ndash; 600 universities in the world by the <a title=\"Times Higher Education World University Rankings\" href=\"https://en.wikipedia.org/wiki/Times_Higher_Education_World_University_Rankings\">Times Higher Education World University Rankings</a> 2022.<sup id=\"cite_ref-timeshighereducation.com_51-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Portsmouth#cite_note-timeshighereducation.com-51\">[50]</a></sup></p>', NULL, NULL, '1', '2023-05-28 04:48:43', '2023-05-28 04:48:43');
INSERT INTO `universities` (`id`, `banner`, `university_name`, `website`, `study_destination_id`, `logo`, `image1`, `image2`, `image3`, `details1`, `details2`, `details3`, `is_active`, `created_at`, `updated_at`) VALUES
(13, '1685271200banner.jpg', 'University of Greenwich', 'https://www.gre.ac.uk/', 1, '1685271200logo.png', '1685271200image.jpg', NULL, NULL, '<p>Greenwich Campus is near 74-hectare <a title=\"Greenwich Park\" href=\"https://en.wikipedia.org/wiki/Greenwich_Park\">Greenwich Park</a>, home to the <a title=\"Royal Observatory, Greenwich\" href=\"https://en.wikipedia.org/wiki/Royal_Observatory,_Greenwich\">Royal Observatory, Greenwich</a>. The Stockwell Street Building opened in 2014 and is now home to the campus library, film and TV studios, and state-of-the-art editing suites. In 2015, it was shortlisted for the <a title=\"Stirling Prize\" href=\"https://en.wikipedia.org/wiki/Stirling_Prize\">Stirling Prize</a> for excellence in architecture.<sup id=\"cite_ref-17\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Greenwich#cite_note-17\">[17]</a></sup></p>\r\n<p>The Dreadnought Building is a central hub for the Greenwich Campus, with further teaching and social spaces.<sup id=\"cite_ref-18\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Greenwich#cite_note-18\">[18]</a></sup></p>\r\n<p>The Student Village at Avery Hill Campus provides accommodation for around 1,000 students. On-site facilities include a caf&eacute;, canteen, shop, launderette, bicycle parking, and a gym.<sup id=\"cite_ref-19\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Greenwich#cite_note-19\">[19]</a></sup></p>\r\n<p>Medway Campus has 350 rooms across five halls of residence dedicated to student accommodation.<sup id=\"cite_ref-20\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Greenwich#cite_note-20\">[20]</a></sup></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3><span id=\"Students\'_Union\" class=\"mw-headline\">Students\' Union</span></h3>\r\n<div class=\"thumbinner\" style=\"width: 202px;\"><a class=\"image\" href=\"https://en.wikipedia.org/wiki/File:Greenwich_Students%27_Union_Logo.jpg\"><img class=\"thumbimage\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/8/8d/Greenwich_Students%27_Union_Logo.jpg/200px-Greenwich_Students%27_Union_Logo.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/8/8d/Greenwich_Students%27_Union_Logo.jpg/300px-Greenwich_Students%27_Union_Logo.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/8/8d/Greenwich_Students%27_Union_Logo.jpg/400px-Greenwich_Students%27_Union_Logo.jpg 2x\" width=\"200\" height=\"158\" data-file-width=\"600\" data-file-height=\"474\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 202px;\">\r\n<div class=\"thumbcaption\">Greenwich Students\' Union Logo</div>\r\n</div>\r\n</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 202px;\"><a class=\"image\" href=\"https://en.wikipedia.org/wiki/File:Bangladesh_students%E2%80%99_society_of_The_University_of_Greenwich.jpg\"><img class=\"thumbimage\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/7/7c/Bangladesh_students%E2%80%99_society_of_The_University_of_Greenwich.jpg/200px-Bangladesh_students%E2%80%99_society_of_The_University_of_Greenwich.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/7/7c/Bangladesh_students%E2%80%99_society_of_The_University_of_Greenwich.jpg/300px-Bangladesh_students%E2%80%99_society_of_The_University_of_Greenwich.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/7/7c/Bangladesh_students%E2%80%99_society_of_The_University_of_Greenwich.jpg/400px-Bangladesh_students%E2%80%99_society_of_The_University_of_Greenwich.jpg 2x\" width=\"200\" height=\"133\" data-file-width=\"2048\" data-file-height=\"1366\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 202px;\">\r\n<div class=\"thumbcaption\">Bangladesh students&rsquo; society</div>\r\n</div>\r\n</div>\r\n<p>Greenwich Students\' Union is the university\'s students\' union. In October 2019, the GSU Student Assembly voted to ask the university to declare a climate emergency and for the university and union <a title=\"Sustainability\" href=\"https://en.wikipedia.org/wiki/Sustainability\">sustainability</a> strategies to consult with students in creating them. This call to action aimed to speed up the university\'s efforts at becoming <a title=\"Carbon neutrality\" href=\"https://en.wikipedia.org/wiki/Carbon_neutrality\">carbon neutral</a>.<sup id=\"cite_ref-21\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Greenwich#cite_note-21\">[21]</a></sup></p>\r\n<p>At the Medway campus in Kent there is a partnership between the University of Greenwich Students\' Union, Canterbury Christ Church and <a title=\"University of Kent\" href=\"https://en.wikipedia.org/wiki/University_of_Kent\">University of Kent</a> Union on the Medway campus. Greenwich Students\' Union has been leading the partnership since July 2021 and manages The Hub space,<sup id=\"cite_ref-22\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Greenwich#cite_note-22\">[22]</a></sup> previously The Student Hub when it was looked after by GK Unions &ndash; the Greenwich &amp; Kent Students\' Unions Together (once the Universities at Medway Students Association, UMSA).</p>\r\n<p>Greenwich Students\' Union delivers at Avery Hill, Greenwich and Medway campus.</p>', NULL, NULL, '1', '2023-05-28 04:53:20', '2023-05-28 04:53:20'),
(14, '1685271427banner.jpg', 'University of South Wales', 'https://www.southwales.ac.uk/', 1, '1685271427logo.png', '1685271427image.webp', NULL, NULL, '<p>The university is part of the University of South Wales Group comprising the university, the <a class=\"mw-redirect\" title=\"Royal Welsh College of Music and Drama\" href=\"https://en.wikipedia.org/wiki/Royal_Welsh_College_of_Music_and_Drama\">Royal Welsh College of Music and Drama</a> and the <a title=\"Merthyr Tydfil College\" href=\"https://en.wikipedia.org/wiki/Merthyr_Tydfil_College\">Merthyr Tydfil College</a>.</p>\r\n<p>The university has a band of 106 partner colleges, universities, FE institutions or organisations, who deliver University of South Wales\'s higher education programmes or <a class=\"mw-redirect\" title=\"Access course\" href=\"https://en.wikipedia.org/wiki/Access_course\">access courses</a> in the UK and 18 other countries.<sup id=\"cite_ref-Collaborator_Colleges_15-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_South_Wales#cite_note-Collaborator_Colleges-15\">[15]</a></sup></p>\r\n<h3><span id=\"Faculties\" class=\"mw-headline\">Faculties</span></h3>\r\n<p>The university has three faculties<sup id=\"cite_ref-16\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_South_Wales#cite_note-16\">[16]</a></sup> spread over its campuses in South East Wales.</p>\r\n<p><strong>Faculty of Computing, Engineering and Science</strong></p>\r\n<ul>\r\n<li>School of Computing and Mathematics</li>\r\n<li><a title=\"School of Engineering, University of South Wales\" href=\"https://en.wikipedia.org/wiki/School_of_Engineering,_University_of_South_Wales\">School of Engineering</a></li>\r\n<li>School of Applied Sciences</li>\r\n</ul>\r\n<p><strong>Faculty of Business &amp; Creative Industries</strong></p>\r\n<ul>\r\n<li>School of Design &amp; Digital</li>\r\n<li>School of Production &amp; Performance</li>\r\n<li><a title=\"South Wales Business School\" href=\"https://en.wikipedia.org/wiki/South_Wales_Business_School\">South Wales Business School</a></li>\r\n</ul>\r\n<p><strong>Faculty of Life Sciences and Education</strong></p>\r\n<ul>\r\n<li>School of Psychology and Therapeutic Studies</li>\r\n<li>School of Education, Early Years and Social Work</li>\r\n<li>School of Health, Sport &amp; Professional Practice</li>\r\n<li>School of Care Sciences</li>\r\n</ul>\r\n<p>The university has a film school, animation facilities, broadcasting studios, a photography school, poets, scriptwriters and authors as well as the national music and drama conservatoire, the <a class=\"mw-redirect\" title=\"Royal Welsh College of Music and Drama\" href=\"https://en.wikipedia.org/wiki/Royal_Welsh_College_of_Music_and_Drama\">Royal Welsh College of Music and Drama</a>, as a wholly owned subsidiary. It offers a range of qualifications from further education to degrees to PhD study. As a <a class=\"mw-redirect\" title=\"New universities (United Kingdom)\" href=\"https://en.wikipedia.org/wiki/New_universities_(United_Kingdom)\">Post 92 University</a> it delivers a range of <a class=\"mw-redirect\" title=\"STEM fields\" href=\"https://en.wikipedia.org/wiki/STEM_fields\">STEM</a> subjects.</p>', NULL, NULL, '1', '2023-05-28 04:57:07', '2023-05-28 04:57:07'),
(15, '1685271704banner.jpg', 'London Metropolitan University', 'https://www.londonmet.ac.uk/', 1, '1685271704logo.webp', '1685271704image.jpg', NULL, NULL, '<p>London Metropolitan University was formed on 1 August 2002 by the merger of <a title=\"London Guildhall University\" href=\"https://en.wikipedia.org/wiki/London_Guildhall_University\">London Guildhall University</a> and the <a title=\"University of North London\" href=\"https://en.wikipedia.org/wiki/University_of_North_London\">University of North London</a>. In October 2006 the University opened a new Science Centre as part of a &pound;30m investment in its science department at the North campus on <a title=\"Holloway Road\" href=\"https://en.wikipedia.org/wiki/Holloway_Road\">Holloway Road</a>, with a \"Super Lab\" claimed to be one of Europe\'s most advanced science teaching facilities,<sup id=\"cite_ref-8\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/London_Metropolitan_University#cite_note-8\">[8]</a></sup><sup id=\"cite_ref-Guardian_Unlimited_9-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/London_Metropolitan_University#cite_note-Guardian_Unlimited-9\">[9]</a></sup><sup id=\"cite_ref-10\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/London_Metropolitan_University#cite_note-10\">[10]</a></sup> and 280 workstations equipped with digital audio visual interactive equipment.</p>\r\n<h3><span id=\"London_Guildhall_University\" class=\"mw-headline\">London Guildhall University</span></h3>\r\n<div class=\"hatnote navigation-not-searchable\" role=\"note\">Further information: <a title=\"London Guildhall University\" href=\"https://en.wikipedia.org/wiki/London_Guildhall_University\">London Guildhall University</a></div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 222px;\"><a class=\"image\" href=\"https://en.wikipedia.org/wiki/File:Crosby_Hall.jpg\"><img class=\"thumbimage\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Crosby_Hall.jpg/220px-Crosby_Hall.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Crosby_Hall.jpg/330px-Crosby_Hall.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/6/6d/Crosby_Hall.jpg 2x\" width=\"220\" height=\"260\" data-file-width=\"381\" data-file-height=\"450\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 222px;\">\r\n<div class=\"thumbcaption\"><a title=\"Crosby Hall, London\" href=\"https://en.wikipedia.org/wiki/Crosby_Hall,_London\">Crosby Hall</a>, Bishopsgate, where the Metropolitan Evening Classes for Young Men started in 1848</div>\r\n</div>\r\n</div>\r\n<p>In 1848 <a title=\"Charles James Blomfield\" href=\"https://en.wikipedia.org/wiki/Charles_James_Blomfield\">Charles James Blomfield</a>, the <a title=\"Bishop of London\" href=\"https://en.wikipedia.org/wiki/Bishop_of_London\">Bishop of London</a>, called upon the clergy to establish evening classes to improve the moral, intellectual and spiritual condition of young men in London. In response, the bishop <a title=\"Charles Mackenzie (bishop)\" href=\"https://en.wikipedia.org/wiki/Charles_Mackenzie_(bishop)\">Charles Mackenzie</a>, instituted the Metropolitan Evening Classes for Young Men in <a title=\"Crosby Hall, London\" href=\"https://en.wikipedia.org/wiki/Crosby_Hall,_London\">Crosby Hall</a>, Bishopsgate, London, with student fees at one shilling per session. Subjects on the original curriculum included Greek, Latin, Hebrew, English, History, Mathematics, Drawing and Natural Philosophy. This fledgling college came under royal patronage following the visit of Prince Albert to the classes in 1851. In 1860 the classes moved to Sussex Hall, the former Livery Hall of the Bricklayers\' Company, in Leadenhall Street. By this time, some 800 students were enrolled annually.</p>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 222px;\"><a class=\"image\" href=\"https://en.wikipedia.org/wiki/File:CityofLondonCollege1883.jpg\"><img class=\"thumbimage\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/d/d0/CityofLondonCollege1883.jpg/220px-CityofLondonCollege1883.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/d/d0/CityofLondonCollege1883.jpg/330px-CityofLondonCollege1883.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/d/d0/CityofLondonCollege1883.jpg/440px-CityofLondonCollege1883.jpg 2x\" width=\"220\" height=\"140\" data-file-width=\"647\" data-file-height=\"413\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 222px;\">\r\n<div class=\"thumbcaption\">City of London College\'s new building at Moorfields in 1883 opened by the then Prince of Wales</div>\r\n</div>\r\n</div>\r\n<p>In 1861 the classes were reconstituted and named the City of London College. Over the next twenty years, the College was one of the pioneers in the introduction of commercial and technical subjects. The college built new premises in White Street at a cost of &pound;16,000 (contributions were received from <a class=\"mw-redirect\" title=\"Victoria of the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Victoria_of_the_United_Kingdom\">Queen Victoria</a> and the <a title=\"Prince of Wales\" href=\"https://en.wikipedia.org/wiki/Prince_of_Wales\">Prince of Wales</a>) and were opened in 1881. In 1891 the college joined <a title=\"Birkbeck, University of London\" href=\"https://en.wikipedia.org/wiki/Birkbeck,_University_of_London\">Birkbeck Institute</a> and the <a class=\"mw-redirect\" title=\"City University, London\" href=\"https://en.wikipedia.org/wiki/City_University,_London\">Northampton Institute</a> to form the City Polytechnic by a Charity Commissioners\' scheme to facilitate funding for these institutions by the City Parochial Foundation, and to enable the three institutions to work cooperatively. However this attempted federation did not function in practice, as each institution continued to operate more or less independently. The City Polytechnic concept was dissolved in 1906 and the City of London College came under the supervision of <a title=\"London County Council\" href=\"https://en.wikipedia.org/wiki/London_County_Council\">London County Council</a>.</p>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 222px;\"><a class=\"image\" href=\"https://en.wikipedia.org/wiki/File:Electra_House.jpg\"><img class=\"thumbimage\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f7/Electra_House.jpg/220px-Electra_House.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/f/f7/Electra_House.jpg/330px-Electra_House.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/f/f7/Electra_House.jpg/440px-Electra_House.jpg 2x\" width=\"220\" height=\"258\" data-file-width=\"2123\" data-file-height=\"2485\" /></a>\r\n<div class=\"thumbcaption\">\r\n<div class=\"magnify\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"thumb tright\">\r\n<div class=\"thumbinner\" style=\"width: 222px;\">\r\n<div class=\"thumbcaption\">Electra House, 84 Moorgate, built by <a title=\"John Belcher (architect)\" href=\"https://en.wikipedia.org/wiki/John_Belcher_(architect)\">John Belcher</a> in 1902, topped by a sculpture of young <a title=\"Atlas (mythology)\" href=\"https://en.wikipedia.org/wiki/Atlas_(mythology)\">Atlases</a> supporting a zodiacal globe by <a class=\"mw-redirect\" title=\"F.W. Pomeroy\" href=\"https://en.wikipedia.org/wiki/F.W._Pomeroy\">F.W. Pomeroy</a>.</div>\r\n</div>\r\n</div>\r\n<p>In December 1940 the college\'s building was destroyed by a German air raid. City of London College subsequently moved into premises at 84 <a title=\"Moorgate\" href=\"https://en.wikipedia.org/wiki/Moorgate\">Moorgate</a> in 1944. In 1948, the City of London College celebrated its centenary with a service of thanksgiving addressed by the Archbishop of Canterbury at <a title=\"St Paul\'s Cathedral\" href=\"https://en.wikipedia.org/wiki/St_Paul%27s_Cathedral\">St Paul\'s Cathedral</a>. In 1970 the college merged with Sir John Cass College to form the City of London Polytechnic. In 1977 it also became the home of the <a title=\"Fawcett Society\" href=\"https://en.wikipedia.org/wiki/Fawcett_Society\">Fawcett Society</a> library, afterwards the <a title=\"Women\'s Library\" href=\"https://en.wikipedia.org/wiki/Women%27s_Library\">Women\'s Library</a>.</p>\r\n<p>Under the <a title=\"Further and Higher Education Act 1992\" href=\"https://en.wikipedia.org/wiki/Further_and_Higher_Education_Act_1992\">Further and Higher Education Act 1992</a> the Polytechnic was awarded university status (having previously awarded degrees of the <a title=\"Council for National Academic Awards\" href=\"https://en.wikipedia.org/wiki/Council_for_National_Academic_Awards\">Council for National Academic Awards</a>). It was renamed London Guildhall University, to demonstrate its links with the City of London and the City\'s many guilds/livery companies. It was unassociated with the Guildhall School of Music and Drama, based at the Barbican Centre. It was ranked 30th out of the UK\'s 43 new universities in the 2001 Research Assessment Exercise. In August 2004, in the midst of a contract dispute with former LGU staff following the merger with the University of North London, it was reported that the management of the merged institution had ordered the destruction of the entire print run of a history of the university &ndash; <em>London Guildhall University: From Polytechnic to University</em> &ndash; authored by Sean Glynn, formerly a senior research fellow in the department of Politics and Modern History; the work had been commissioned by Sir <a title=\"Roderick Floud\" href=\"https://en.wikipedia.org/wiki/Roderick_Floud\">Roderick Floud</a>, the President of London Metropolitan University, when Provost of LGU.<sup id=\"cite_ref-11\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/London_Metropolitan_University#cite_note-11\">[11]</a></sup></p>\r\n<p>The former LGU campus, which was home to London Met\'s Guildhall School of Business and Law until August 2019, was located at the intersection of the City of London financial district and the old East End, near <a class=\"mw-redirect\" title=\"Aldgate East\" href=\"https://en.wikipedia.org/wiki/Aldgate_East\">Aldgate East</a>, <a title=\"Tower Hill\" href=\"https://en.wikipedia.org/wiki/Tower_Hill\">Tower Hill</a> and <a title=\"Liverpool Street station\" href=\"https://en.wikipedia.org/wiki/Liverpool_Street_station\">Liverpool Street</a> <a title=\"London Underground\" href=\"https://en.wikipedia.org/wiki/London_Underground\">tube</a> stations. There are buildings located at Minories, Jewry Street, Central House, Moorgate, Whitechapel High Street, Calcutta House, Commercial Road and Goulston Street. There is a gymnasium for the use of staff and students at the Whitechapel High St. building,</p>', NULL, NULL, '1', '2023-05-28 05:01:44', '2023-05-28 05:01:44'),
(16, '1685272348banner.jpg', 'University of the West of Scotland', 'https://www.uws.ac.uk/', 1, '1685272348logo.jpg', '1685272348image.jpg', NULL, NULL, '<p>The Students\' Association of the University of the West of Scotland is officially the recognised student organisation across the university. The organisation exists to campaign on students\' issues, to improve learning and teaching at UWS, to offer advice and support to students, to organise events and activities, and to enable societies across all campuses.<sup id=\"cite_ref-33\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_the_West_of_Scotland#cite_note-33\">[33]</a></sup></p>\r\n<p>The majority of the Student Groups and Societies are available to Scottish-based UWS campuses and are run by students for students. These include religious, political and social societies as well as course-based groups.<sup id=\"cite_ref-34\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_the_West_of_Scotland#cite_note-34\">[34]</a></sup> There are also a collection of liberation groups and peer support groups, which exist to counter under-represented and oppressed sections of the student body.<sup id=\"cite_ref-35\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_the_West_of_Scotland#cite_note-35\">[35]</a></sup></p>\r\n<p>SAUWS operates Union bars at their Paisley and Ayr locations, where they host various events and activities including quiz nights and karaoke.</p>\r\n<p>In 2016 SAUWS won the NUS Scotland award \"Higher Education Student Association of the Year\". This was awarded due to the organisations work and campaigns such as <em>Keep UWS in Hamilton</em>, the <em>Summer Safety Net</em> campaign, and its work developing services for students.<sup id=\"cite_ref-36\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_the_West_of_Scotland#cite_note-36\">[36]</a></sup> SAUWS was awarded \"University Students\' Association of the Year\" by NUS Scotland once again in 2020.<sup id=\"cite_ref-37\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_the_West_of_Scotland#cite_note-37\">[37]</a></sup></p>', NULL, NULL, '1', '2023-05-28 05:12:28', '2023-05-28 05:12:28'),
(17, '1685272551banner.jpg', 'De Montfort University', 'https://www.dmu.ac.uk/international/en/regions/south-asia.aspx?gclid=EAIaIQobChMI05CmmvGX_wIVlWl9Ch1Yrg_uEAAYASAAEgKWTvD_BwE', 1, '1685272551logo.png', '1685272551image.jpg', NULL, NULL, '<p dir=\"ltr\">De Montfort University (DMU) is located in <a class=\"sys_0 sys_t0\" title=\"A student\'s guide to Leicester\" href=\"https://www.dmu.ac.uk/study/leicester/index.aspx\">Leicester</a>, which is a very multicultural city, with a large South Asian population.&nbsp;Our award-winning careers commitment provides you with guaranteed access to work experience opportunities, flexible career support tailored to your needs, placement years that count towards your degree and unlimited digital tools.</p>\r\n<p>We offer more than 300 courses at undergraduate and postgraduate level within the fields of Art, Business, Computing, Engineering, Design, Humanities, Law, Health &amp; Life Sciences plus much more. Many of our courses offer professional accreditations, links to industry or work experience.</p>\r\n<p dir=\"ltr\">De Montfort University has a number of active societies which you can join upon your arrival. We have very active <a class=\"sys_16\" href=\"https://www.facebook.com/DMU123IndianSociety/\">Indian</a>, <a class=\"sys_16\" href=\"https://www.facebook.com/DmuPaksoc/\">Pakistani</a> and <a class=\"sys_16\" href=\"https://www.demontfortsu.com/organisation/14509/\">Nepalese</a> societies&nbsp;who host several events throughout the year, in addition to a number of other <a class=\"sys_16\" href=\"https://www.demontfortsu.com/activities/studentgroups/\">student societies and clubs</a>.</p>\r\n<p dir=\"ltr\"><a class=\"sys_0 sys_t0\" title=\"A student\'s guide to Leicester\" href=\"https://www.dmu.ac.uk/study/leicester/index.aspx\">Leicester</a>&nbsp;offers everything you expect from a city and more &ndash; all on your doorstep.&nbsp;There are great shops, bars and restaurants just a short distance from campus. Leicester was also named the fourth most vibrant city in the UK, putting it ahead of the likes of Bristol, Edinburgh, Leeds and London (Top Cities Vibrancy Report, 2022), as well as the best city in the East Midlands to live and work (Good Growth for Cities Index, 2022). Leicester is rich in culture and diversity, making it feel like the world is on your doorstep. It&rsquo;s home to one of the biggest celebrations of Diwali outside of India, too.</p>\r\n<p>Take a look below for everything you need to know about becoming a student at DMU and if you have any other questions please get in touch with our dedicated <a class=\"sys_0 sys_t0\" title=\"Meet the International Office\" href=\"https://www.dmu.ac.uk/international/en/international-office.aspx\">international team</a>.</p>', NULL, NULL, '1', '2023-05-28 05:15:51', '2023-05-28 05:15:51'),
(18, '1685272971banner.jpg', 'London South Bank University', 'https://www.lsbu.ac.uk', 1, '1685272971logo.jpg', '1685272971image.jpg', NULL, NULL, '<p>From 1945 to 1953, British painter <a title=\"David Bomberg\" href=\"https://en.wikipedia.org/wiki/David_Bomberg\">David Bomberg</a> taught art at the Polytechnic forming the \'<a title=\"Borough Group\" href=\"https://en.wikipedia.org/wiki/Borough_Group\">Borough Group</a>\' of artists with his pupils in 1946.<sup id=\"cite_ref-15\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/London_South_Bank_University#cite_note-15\">[15]</a></sup> In 1956, the Polytechnic was designated a Regional College of Technology and Dr J E Garside was installed as the new Principal until 1965, when Vivian Pereira-Mendoza took over. Further extensions to the buildings were made during the 1960s with the opening of the National College Wing in 1961 and the extension buildings and Tower Block in 1969, which were officially opened by <a title=\"Prince Philip, Duke of Edinburgh\" href=\"https://en.wikipedia.org/wiki/Prince_Philip,_Duke_of_Edinburgh\">Prince Philip, Duke of Edinburgh</a>.</p>\r\n<p>In 1970, the Brixton School of Building (founded in 1904), the City of Westminster College (founded in 1918 &ndash; and not the same institution as the current <a title=\"City of Westminster College\" href=\"https://en.wikipedia.org/wiki/City_of_Westminster_College\">City of Westminster College</a>) and the National College of Heating, Ventilating, Refrigeration and Fan Engineering (founded in 1947) merged with the Polytechnic to become the <a class=\"mw-redirect\" title=\"Polytechnic of the South Bank\" href=\"https://en.wikipedia.org/wiki/Polytechnic_of_the_South_Bank\">Polytechnic of the South Bank</a>. The new institution adopted a coat of arms designed to include two <a class=\"mw-redirect\" title=\"Thames barge\" href=\"https://en.wikipedia.org/wiki/Thames_barge\">Thames barges</a> set above a pentagon surrounded by five other pentagons. An official designation service took place the following year, at which <a title=\"Margaret Thatcher\" href=\"https://en.wikipedia.org/wiki/Margaret_Thatcher\">Margaret Thatcher</a> was the guest speaker. In 1972 the purpose-built Wandsworth Road site opened, providing space for the Polytechnic\'s Faculty of the Built Environment, which at the time was the biggest and most comprehensive faculty in Europe for teaching built environment subjects such as surveying, town planning, architecture and other property related professional disciplines. In 1975, the extensive <a title=\"London Road, Southwark\" href=\"https://en.wikipedia.org/wiki/London_Road,_Southwark\">London Road</a> building was opened, providing space for expanding business courses and the library. In 1976, part of Rachel MacMillan College of Education merged with the Polytechnic along with the Battersea College of Education bringing with them sites at <a title=\"Parkstead House\" href=\"https://en.wikipedia.org/wiki/Parkstead_House\">Manresa House</a>, <a title=\"Roehampton\" href=\"https://en.wikipedia.org/wiki/Roehampton\">Roehampton</a> and Manor House, <a title=\"Clapham Common\" href=\"https://en.wikipedia.org/wiki/Clapham_Common\">Clapham Common</a>.<sup class=\"noprint Inline-Template Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources. (October 2017)\">citation needed</span></a></em>]</sup></p>\r\n<p>In 1985 <a title=\"South Bank Technopark\" href=\"https://en.wikipedia.org/wiki/South_Bank_Technopark\">South Bank Technopark</a> opened on London Road and in 1987 the Polytechnic changed its name again to become South Bank Polytechnic. In the same year, the <a title=\"British Youth Opera\" href=\"https://en.wikipedia.org/wiki/British_Youth_Opera\">British Youth Opera</a> (BYO) was founded and made a home at the Polytechnic\'s Southwark campus. In 1987, <a title=\"Pauline Perry, Baroness Perry of Southwark\" href=\"https://en.wikipedia.org/wiki/Pauline_Perry,_Baroness_Perry_of_Southwark\">Pauline Perry, Baroness Perry of Southwark</a> was appointed Director, who oversaw the conversion of the Polytechnic into a flagship university.<sup class=\"noprint Inline-Template Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources. (October 2017)\">citation needed</span></a></em>]</sup></p>\r\n<p>In 1990, the Polytechnic was accredited for Research Degrees and in 1991 the Central Catering College at Waterloo and South West London College merged with it. In 1992, the newly created Baroness Perry (August 1991) became the University\'s first Vice-Chancellor.<sup class=\"noprint Inline-Template Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources. (October 2017)\">citation needed</span></a></em>]</sup></p>\r\n<p>In 1992, the Polytechnic was granted university status and accordingly changed its name to South Bank University. That year also saw the new university celebrate its centenary and adopt the marketing slogan, \"the University without Ivory Towers\". In 1993, <a title=\"Gerald Bernbaum\" href=\"https://en.wikipedia.org/wiki/Gerald_Bernbaum\">Gerald Bernbaum</a> was appointed Vice-Chancellor and the Centenary Library was renamed the Perry Library. Redwood College of Health Studies and <a class=\"mw-redirect\" title=\"Great Ormond Street\" href=\"https://en.wikipedia.org/wiki/Great_Ormond_Street\">Great Ormond Street</a> School of Nursing merged with the university in 1995, leading to the establishment of two satellite campuses teaching Health at <a class=\"mw-redirect\" title=\"Havering\" href=\"https://en.wikipedia.org/wiki/Havering\">Havering</a> and Whipps Cross (which closed in 2011).<sup class=\"noprint Inline-Template Template-Fact\">[<em><a title=\"Wikipedia:Citation needed\" href=\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources. (October 2017)\">citation needed</span></a></em>]</sup></p>', NULL, NULL, '1', '2023-05-28 05:22:51', '2023-05-28 05:22:51'),
(19, '1685273208banner.jpg', 'BPP University', 'https://www.bpp.com', 1, '1685273208logo.png', '1685273208image.webp', NULL, NULL, '<p>BPP was first granted degree-awarding powers in 2007, and degree-awarding powers for an indefinite time period in 2020.<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/BPP_University#cite_note-2\">[2]</a></sup><sup id=\"cite_ref-3\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/BPP_University#cite_note-3\">[3]</a></sup> On 8 August 2013, BPP University College of Professional Studies was granted the title of university and rebranded as BPP University.<sup id=\"cite_ref-4\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/BPP_University#cite_note-4\">[4]</a></sup> That November, BPP was awarded the EducationInvestor magazine\'s \"Higher/Professional Education Provider of the Year 2013\" title.<sup id=\"cite_ref-5\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/BPP_University#cite_note-5\">[5]</a></sup> The August 2013 granting of university status to BPP was criticised by the <a title=\"University and College Union\" href=\"https://en.wikipedia.org/wiki/University_and_College_Union\">University and College Union</a> in an open letter.<sup id=\"cite_ref-6\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/BPP_University#cite_note-6\">[6]</a></sup> During the previous March, the union had written to then UK Business Secretary <a title=\"Vince Cable\" href=\"https://en.wikipedia.org/wiki/Vince_Cable\">Vince Cable</a>, urging him to suspend BPP\'s application for university title, pending an investigation into its relationship with its parent companies, saying, \"At risk are both the interests of BPP students and the international credibility of the UK university title.\"<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/BPP_University#cite_note-7\">[7]</a></sup></p>\r\n<p>&nbsp;</p>\r\n<p><sup class=\"reference\">In September 2017, <em><a title=\"Times Higher Education\" href=\"https://en.wikipedia.org/wiki/Times_Higher_Education\">Times Higher Education</a></em> reported that BPP had shut down its degree programme in <a title=\"Dentistry\" href=\"https://en.wikipedia.org/wiki/Dentistry\">dental and oral sciences</a> with immediate effect after it failed to meet <a title=\"General Dental Council\" href=\"https://en.wikipedia.org/wiki/General_Dental_Council\">General Dental Council</a> standards just a year after launching the course in 2016, leaving new students unable to start and existing <a title=\"Undergraduate education\" href=\"https://en.wikipedia.org/wiki/Undergraduate_education\">undergraduate</a> students facing an uncertain future.<sup id=\"cite_ref-8\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/BPP_University#cite_note-8\">[8]</a></sup></sup></p>', NULL, NULL, '1', '2023-05-28 05:26:48', '2023-05-28 05:26:48'),
(20, NULL, 'University of Strathclyde', 'https://www.strath.ac.uk/studywithus/internationalstudents/southasia/?utm_medium=paid%20search&utm_source=google&utm_campaign=central%20pgt%202022-23%20-%20564327&utm_content=brand%20pg%20&utm_term=strathclyde%20uni&gclid=EAIaIQobChMIr5KCjPSX_wIVlGF9Ch03zwtWEAAYASAAEgJlmfD_BwE&gclsrc=aw.ds', 1, '1685273414logo.jpg', '1685273414image.png', NULL, NULL, '<p>The university is highly ranked among the top 10 in the UK in various subjects according to the Complete University Guide 2019,<sup id=\"cite_ref-40\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-40\">[36]</a></sup> namely being 1st for Accounting &amp; Finance; 1st for Social Policy; 1st for Aural &amp; Oral Sciences; 1st for Communication &amp; Media Studies; 1st for Pharmacology and Pharmacy; 1st for Medical Technology; 1st for Hospitality, Leisure, Recreation &amp; Tourism; 2nd for Marketing; 2nd for Forensic Science; 5th for Architecture; 5th for English; 6th for Business &amp; Management Studies; 6th for Electrical &amp; Electronic Engineering; 7th for Chemical Engineering; 8th for Civil Engineering; 8th for General Engineering and 9th for Mechanical Engineering. The university is ranked in the top ten universities in Britain in the subject Politics according to the Complete University Guide 2022.<sup id=\"cite_ref-41\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-41\">[37]</a></sup> The university also ranked second in 2019 on social policy and administration in the national ranking according to <a title=\"The Guardian\" href=\"https://en.wikipedia.org/wiki/The_Guardian\">The Guardian</a>.<sup id=\"cite_ref-42\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-42\">[38]</a></sup>Times Higher Education (THE) placed History at Strathclyde 9th for research intensity in a field of 83 UK universities in the 2014 REF.<sup id=\"cite_ref-43\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-43\">[39]</a></sup></p>\r\n<p>Strathclyde is placed in the top 20 of European business schools in the Financial Times Global MBA Rankings .<sup id=\"cite_ref-44\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-44\">[40]</a></sup> In this regard, QS World University Ranking placed Strathclyde among 51-100 best universities in business management. Strathclyde Master\'s programs take 36th place globally in marketing, 51st place globally in business analysis and 55th globally in management, according to QS World University Ranking in 2020.<sup id=\"cite_ref-45\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-45\">[41]</a></sup></p>\r\n<p>The University School of Government and Public Policy has a long tradition of interacting with national and global media organizations, governments, parliaments and international organizations such as the EU and OECD. Political science therefore takes 1st place in Scotland in the terms of research intensity. According to URAP Center Ranking, which has been publishing annual rankings since 2010 for each subject, the University of Strathclyde is constantly included in the top 120 global universities in politics.<sup id=\"cite_ref-46\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-46\">[42]</a></sup><sup id=\"cite_ref-47\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-47\">[43]</a></sup> In 2013, QS World University Ranking placed Strathclyde among 101-150 best global universities in politics and international relations.<sup id=\"cite_ref-48\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-48\">[44]</a></sup> In 2020, ARWU ranked Strathclyde in the 101-150 best Political Science universities.<sup id=\"cite_ref-49\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-49\">[45]</a></sup> Ever since ARWU began to publish a separate subject ranking on Public Administration, Strathclyde has consistently ranked internationally among 76-100 best universities in 2017, 2018, 2019 and 2020.<sup id=\"cite_ref-50\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-50\">[46]</a></sup></p>\r\n<p>According to The Complete University Guide, Strathclyde Law School is in the UK\'s top 10 (2020). According to Times Higher Education, the University of Strathclyde was placed 76th best in law globally among universities in 2018.<sup id=\"cite_ref-51\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-51\">[47]</a></sup></p>\r\n<p>QS World University Rankings 2018<sup id=\"cite_ref-52\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/University_of_Strathclyde#cite_note-52\">[48]</a></sup> placed the university among the top 25 internationally for Hospitality &amp; Leisure Management, 51-100 for Pharmacy, 51-100 for Business &amp; Management, 101-150 for Electrical &amp; Electronic Engineering, 101-150 for Architecture, 101-150 for Education, 151-200 for Accounting &amp; Finance, 151-200 for Law, 151-200 for Civil &amp; Structural Engineering, 151-200 for Mechanical Engineering, 201-250 for Chemical Engineering, 201-250 for Physics and Astronomy, 251-300 for Sociology, 251-300 for Economics, 251-300 for Materials Sciences, 301-350 for Mathematics and 301-350 for Computer Science &amp; Information Systems.</p>\r\n<p>The University of Strathclyde is a 5-star QS-rated university.</p>\r\n<p>The university is one of the 39 old universities in the UK comprising the distinctive <strong>Cluster Two</strong> of elite universities after <a title=\"Oxbridge\" href=\"https://en.wikipedia.org/wiki/Oxbridge\">Oxbridge</a>. A detailed study published in 2015 by Vikki Boliver has shown among the Old universities, Oxford and Cambridge emerge as an elite tier, whereas the remaining 22 <a class=\"mw-redirect\" title=\"Russell Group universities\" href=\"https://en.wikipedia.org/wiki/Russell_Group_universities\">Russell Group universities</a> are undifferentiated from 17 other prestigious Old universities (including the University of Strathclyde) which form the second cluster.</p>', NULL, NULL, '1', '2023-05-28 05:30:14', '2023-05-28 05:30:14'),
(21, '1685273690banner.jpg', 'University of Ulster', 'https://www.ulster.ac.uk', 1, '1685273690logo.png', '1685273690image.jpg', NULL, NULL, '<p>The university\'s course provision is the largest in Northern Ireland, covering arts, business, engineering, information technology, life and health sciences, management, and social sciences. Courses have a strong <a class=\"mw-redirect\" title=\"Vocational\" href=\"https://en.wikipedia.org/wiki/Vocational\">vocational</a> element and the majority include a period of industrial or professional placement.</p>\r\n<h3><span id=\"Rankings\" class=\"mw-headline\">Rankings</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: Rankings\" href=\"https://en.wikipedia.org/w/index.php?title=Ulster_University&amp;action=edit&amp;section=14\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\r\n<table class=\"infobox\"><caption class=\"infobox-title\"><a title=\"College and university rankings\" href=\"https://en.wikipedia.org/wiki/College_and_university_rankings\">Rankings</a></caption>\r\n<tbody>\r\n<tr>\r\n<th class=\"infobox-header\" colspan=\"2\"><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom\">National rankings</a></th>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom#The_Complete_University_Guide\">Complete</a></em> (2023)<sup id=\"cite_ref-Complete_League_Table_41-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-Complete_League_Table-41\">[41]</a></sup></th>\r\n<td class=\"infobox-data\">44</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom#The_Guardian\">Guardian</a></em> (2023)<sup id=\"cite_ref-The_Guardian_University_Guide_42-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-The_Guardian_University_Guide-42\">[42]</a></sup></th>\r\n<td class=\"infobox-data\">38</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom#The_Times/The_Sunday_Times\">Times / Sunday Times</a></em> (2023)<sup id=\"cite_ref-The_Times_and_Sunday_Times_University_Guide_43-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-The_Times_and_Sunday_Times_University_Guide-43\">[43]</a></sup></th>\r\n<td class=\"infobox-data\">38</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-header\" colspan=\"2\">Global rankings</th>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"QS World University Rankings\" href=\"https://en.wikipedia.org/wiki/QS_World_University_Rankings\">QS</a></em> (2023)<sup id=\"cite_ref-QS_World_University_Rankings_44-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-QS_World_University_Rankings-44\">[44]</a></sup></th>\r\n<td class=\"infobox-data\">601-650</td>\r\n</tr>\r\n<tr>\r\n<th class=\"infobox-label\" scope=\"row\"><em><a title=\"Times Higher Education World University Rankings\" href=\"https://en.wikipedia.org/wiki/Times_Higher_Education_World_University_Rankings\">THE</a></em> (2023)<sup id=\"cite_ref-THE_World_University_Rankings_45-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-THE_World_University_Rankings-45\">[45]</a></sup></th>\r\n<td class=\"infobox-data\">601-800</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>The university is ranked annually by the <em><a title=\"Rankings of universities in the United Kingdom\" href=\"https://en.wikipedia.org/wiki/Rankings_of_universities_in_the_United_Kingdom\">Complete University Guide</a></em>, <em><a title=\"The Guardian\" href=\"https://en.wikipedia.org/wiki/The_Guardian\">The Guardian</a></em>, and jointly by <em><a title=\"The Times\" href=\"https://en.wikipedia.org/wiki/The_Times\">The Times</a></em>and <em><a title=\"The Sunday Times\" href=\"https://en.wikipedia.org/wiki/The_Sunday_Times\">The Sunday Times</a></em>; this makes up the UK University League Table rankings. It was shortlisted for <a title=\"Sunday Times University of the Year\" href=\"https://en.wikipedia.org/wiki/Sunday_Times_University_of_the_Year\">Sunday Times University of the Year</a> in 2001.</p>\r\n<p>The institution is a leading modern university ranked in the top 150 global institutions under 50 years of age in The Times Higher Education 150 Under 50 World University rankings.<sup id=\"cite_ref-46\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-46\">[46]</a></sup></p>\r\n<p>Ulster is in the top 20% in international outlook in 2016, registering as 401 - 500 in the THE World University Rankings.<sup id=\"cite_ref-THE_World_University_Rankings_2015_47-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-THE_World_University_Rankings_2015-47\">[47]</a></sup></p>\r\n<p>Ulster scores highly for student satisfaction with the 2018 National Student Survey unveiling 87% satisfaction rates&mdash;ranking 23rd out of 154 UK universities.<sup id=\"cite_ref-National_Student_Survey_2015_48-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Ulster_University#cite_note-National_Student_Survey_2015-48\">[48]</a></sup></p>\r\n<p>In 2019 Ulster ranked 2nd in the UK for the UK University Acceptance rates on a university review platform StudentCrowd.</p>', NULL, NULL, '1', '2023-05-28 05:34:50', '2023-05-28 05:34:50'),
(22, '1685273889banner.jpg', 'Northumbria University', 'https://www.northumbria.ac.uk', 1, '1685273889logo.png', '1685273889image.jpg', NULL, NULL, '<p>Northumbria was one of the best performing universities in the 2021 Research Excellence Framework, rising the highest number of places in a ranking of \'research power\' by THE. The university climbed to 23rd place from 50th in 2014 and 80th in 2008.<sup id=\"cite_ref-41\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Northumbria_University#cite_note-41\">[41]</a></sup></p>\r\n<p>In the UK <a title=\"Research Assessment Exercise\" href=\"https://en.wikipedia.org/wiki/Research_Assessment_Exercise\">Research Assessment Exercise</a> 2008 some research in nine of twelve areas submitted was described as \"world-leading\".<sup id=\"cite_ref-RAENorthumbria_42-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Northumbria_University#cite_note-RAENorthumbria-42\">[42]</a></sup> In the 2014 Research Assessment Exercise, Northumbria was one of the UK top 50 for research power and the university which had risen fastest up the rankings.<sup id=\"cite_ref-43\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Northumbria_University#cite_note-43\">[43]</a></sup></p>\r\n<h3><span id=\"Reputation_and_rankings\" class=\"mw-headline\">Reputation and rankings</span></h3>\r\n<ul>\r\n<li>Northumbria was named UK University of the Year by Times Higher Education in November 2022.<sup id=\"cite_ref-44\" class=\"reference\"></sup></li>\r\n<li>Northumbria University is in the top 25 for research power in the UK, according to the results of the 2021 Research Excellence Framework, Times Higher Education REF2021 rankings.</li>\r\n<li>Northumbria University is the top University in the North East for&nbsp;sustainability,<sup id=\"cite_ref-45\" class=\"reference\"></sup> according to the People and Planet league table</li>\r\n<li>Northumbria is one of the highest ranked UK universities in the Times Higher Education\'s Young Universities Rankings (2022-).</li>\r\n</ul>', NULL, NULL, '1', '2023-05-28 05:38:09', '2023-05-28 05:38:09');

